                    <h2>Activities</h2>
                    <label class="container">One
                        <input type="checkbox"  />
                        <span class="checkmark"></span>
                    </label>
                    <label class="container">two
                        <input type="checkbox"  />
                        <span class="checkmark"></span>
                    </label>
                    <label class="container">three
                        <input type="checkbox"  />
                        <span class="checkmark"></span>
                    </label>

                </div>
            </div>
        );
    }
}

export default Activity;
